import React from 'react';
import '../MyInfo.css';

const InfoUser = () => {
    return (
        <div className="BlockContainer">
            <div className="TitleBackground">
                <h4 className='h4'>Info User</h4>
            </div>
            <div className="BlockUserInfo">
                <div className='BoxInput'>
                     <div className={classes.Duo}>
                        <input className={classes.Input} type="text" id="lastName" placeholder="Nom" onChange={(e) => this.changedHandler(e, 2, 20)} />
                        <div className={classes.Error}>{this.state.errors.lastName}</div>
                    </div>
                </div>
            </div>
        </div>
    )
}

export default InfoUser;
